# frozen_string_literal: true

# This example is based on this question:
# https://stackoverflow.com/questions/51955217/import-data-from-csv-into-two-tables-in-rails

require 'spec_helper'

# Examples
# ========

RSpec.describe 'Employee', type: :model do
  before(:all) do
    # Set up Models
    # =============

    class Employee < ActiveRecord::Base
      # Generated by first running:  Parent.suggest_template(true, true, 1)
      # And then just added :children_firstname to the uniques,
      # and the six column aliases in the :as portion.

      # validates_presence_of :hire_date

      # Can't do required: false in AR < 4.2
      if ActiveRecord.version < Gem::Version.new('4.2')
        belongs_to :reports_to, class_name: name
      else
        # Note that required: false is available from Rails 4.2 onwards, and works the same as
        # optional: true in Rails 5.0 and later.
        belongs_to :reports_to, class_name: name, required: false
      end

      has_many :orders
    end
    class Customer < ActiveRecord::Base
      has_many :orders
    end
    class Order < ActiveRecord::Base
      # belongs_to :ship_via, class_name: "Shipper", foreign_key: :ship_via_id, inverse_of: :orders
      belongs_to :customer
      belongs_to :employee

      has_many :order_details
    end
    class Category < ActiveRecord::Base
      has_many :products
    end
    class Product < ActiveRecord::Base
      # belongs_to :supplier
      belongs_to :category

      has_many :order_details
    end
    class OrderDetail < ActiveRecord::Base
      belongs_to :order
      belongs_to :product
    end
  end

  def clear_table(model, starting_id = 1)
    model.destroy_all
    return unless model.count == 0 && ActiveRecord::Base.connection.class.name.end_with?('::PostgreSQLAdapter')

    ActiveRecord::Base.connection.execute("SELECT setval('#{model.table_name}_#{model.primary_key}_seq', #{starting_id}, false);")
    # x = ActiveRecord::Base.connection.execute "SELECT c.relname FROM pg_class c WHERE c.relkind = 'S';"
  end

  before(:each) do
    clear_table(OrderDetail)
    clear_table(Order, 10_248)
    clear_table(Product)
    clear_table(Category)
    clear_table(Employee)
    clear_table(Customer)
  end

